import React from "react";
import { Route, Switch } from "react-router-dom";
import ToDoList from "./ToDoList";


function App(){
    return (
        <div>
            <Switch>
                <Route component={ToDoList} exact path="/" />
                <Route component={Update} path="/update" />
            </Switch>
        </div>
        
    )    

}

export default App;
